function CartItem({ item }) {
  return (
    <div className="cart-item">
      <img src={item.image} alt={item.title} />
      <div>
        <h3>{item.title}</h3>
        <p>Price: ${item.price}</p>
      </div>
    </div>
  );
}

export default CartItem;
